function DessertsList(props) {
	// Implement the component here.
	let list_desserts_1 = props.data.filter(desserts => desserts.calories > 300);
	let list_desserts = props.data.map((desserts) => {
		return (
			<li>
				{desserts.name} - {desserts.calories} cal
			</li>
		);
	});

	return (
		<div>
			<h1>Desserts</h1>
			<ul>{list_desserts}</ul>
		</div>
	);
}

export default DessertsList;
